import { Injectable } from '@angular/core';

interface ISignDictionary {
  [dataURI: string]: string;
}

@Injectable({
  providedIn: 'root'
})
export class SignDictionaryService {
  public get: ISignDictionary = {};

  constructor() {
    this.get['empty'] = '';
    this.get['+'] = '';
    this.get['-'] = '';
    this.get['x'] = '';
    this.get['/'] = '';
    this.get['='] = '';
    this.get['0'] = '';
    this.get['1'] = '';
    this.get['2'] = '';
    this.get['3'] = '';
    this.get['4'] = '';
    this.get['5'] = '';
    this.get['6'] = '';
    this.get['7'] = '';
    this.get['8'] = '';
    this.get['9'] = '';
    this.get['.'] = '';
    this.get['_'] = '';

  }
}
